// App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import HomePage from "./Homepage";
import LoginPage from "./loginA";
import LoginPageF from "./loginF";
import NewLog from "./emailRecup";
import StudentPage from "./Studentpage";
import Aulinhas from "./Aulas";
import Notas from "./Notas";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/loginA" element={<LoginPage />} />
        <Route path="/loginF" element={<LoginPageF />} />
        <Route path="/emailRecup" element={<NewLog />} />
        <Route path="/Studentpage" element={<StudentPage />} />
        <Route path="/Aulas" element={<Aulinhas />} />
        <Route path="/Notas" element={<Notas />} />
      </Routes>
      <VideoAulas
        videoUrl="https://www.udemy.com/course/100-days-of-code/learn/lecture/17965118#overview"
        posterUrl="/images/reactlogo"
      />
    </Router>
  );
}

export default App;
